import React, { Component } from "react";

// basic user interface
// create class for component
class Main extends Component {
  render() {
    return (
      <div id="content" className="mt-3">
        <table>
          <thead>
            <tr>
              <th></th>
              <th></th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td></td>
            </tr>
          </tbody>
        </table>
      </div>
    );
  }
}

export default Main;
